import React, {Fragment} from 'react';

class Content extends React.Component {
    render() {
        return(
            <Fragment>
                <div className='content'>
                    <Switch>
                        <Route exact path='/songs' component={ Canciones }/>
                     </Switch>
                </div>
            </Fragment>
        );
    }
}

export default Content;
